            "visualizaQuestao": "<div class=\"adaptive-block-avalicao-visualize\">\t\n\t\t\n\t\t\n\t\t<div   class=\"ng-binding ng-scope\"><p>Os sucos de frutas cítricas mais comuns no Brasil são os de laranja e limão. Estas frutas proporcionam benefícios à saúde, pois possuem atividade antioxidante e anti-inflamatória. Essas propriedades são consequência da diversidade de substâncias que constituem os frutos da laranja e do limão, porém o aroma característico em cada uma destas frutas é consequência do Limoneno.&nbsp;</p><figure class=\"image\"><img src=\"data:image/png;base64,\"></figure></div>\n\t\t\n\t\t<div  style=\"padding-bottom: 12px;\" class=\"ng-scope\"></div>\t\t\t\t\t\t\t\t\n\t\t\n\t\t<div   class=\"ng-binding ng-scope\"><p>Sobre as estruturas químicas dos estereoisômeros do Limoneno da laranja e do limão, avalie as seguintes afirmações:&nbsp;</p><p>I – são enantiômeros;&nbsp;</p><p>II - podem ser classificados como diastereoisômeros, visto que as moléculas são assimétricas;&nbsp;</p><p>III - o estereoisômero <i>R&nbsp;</i>é o responsável pelo aroma da laranja e experimentalmente desvia a luz polarizada para a direita;&nbsp;</p><p>IV - o responsável pelo aroma da limão experimentalmente desvia a luz polarizada para a direita.</p><p>&nbsp;</p><p>Estão corretas:&nbsp;</p></div>\n\t\t\n\t\t<div class=\"coluna-sm-12 adaptive-margin-bottom\">\n\t\t\t<div class=\"linha-alternativa ng-scope\"  >\n\t\t\t\t<span class=\"media-esq ng-binding\" >A (&nbsp;&nbsp;&nbsp;)</span>\n\t\t\t\t<span class=\"media-corpo ng-binding\" ><p>I, II e III.</p></span>\n\t\t\t</div><div class=\"linha-alternativa ng-scope\"  >\n\t\t\t\t<span class=\"media-esq ng-binding\" >B (&nbsp;&nbsp;&nbsp;)</span>\n\t\t\t\t<span class=\"media-corpo ng-binding\" ><p>I e III.</p></span>\n\t\t\t</div><div class=\"linha-alternativa ng-scope\"  >\n\t\t\t\t<span class=\"media-esq ng-binding\" >C (&nbsp;&nbsp;&nbsp;)</span>\n\t\t\t\t<span class=\"media-corpo ng-binding\" ><p>I e IV.</p></span>\n\t\t\t</div><div class=\"linha-alternativa ng-scope\"  >\n\t\t\t\t<span class=\"media-esq ng-binding\" >D (&nbsp;&nbsp;&nbsp;)</span>\n\t\t\t\t<span class=\"media-corpo ng-binding\" ><p>II e III.</p></span>\n\t\t\t</div><div class=\"linha-alternativa ng-scope\"  >\n\t\t\t\t<span class=\"media-esq ng-binding\" >E (&nbsp;&nbsp;&nbsp;)</span>\n\t\t\t\t<span class=\"media-corpo ng-binding\" ><p>II e IV.</p></span>\n\t\t\t</div>\n\t\t</div>\t\n\t</div>",
