      "visualizaQuestao": "\n      <div class=\"adaptive-block-avalicao-visualize\">\n        \n        \n\n        <p style=\"text-align:justify;\">A corrente naturalista (fragmento de O mundo de Sofia)<br>- (..) Vamos falar agora de Marx, Darwin ou Freud?<br>— Em termos bem gerais, podemos falar de uma corrente naturalista, que se estende de meados do século XIX até bem recentemente. Por \"naturalismo\" entende-se uma concepção de realidade que não aceita qualquer outra realidade a não ser a natureza e o mundo fenomenológico. Consequentemente, o naturalista considera o homem parte da natureza e o pesquisador natural parte exclusivamente de dados concretos da natureza, e não de especulações racionalistas ou de alguma outra forma de revelação divina.<br>— E isto vale tanto para Marx quanto Darwin e Freud?<br>- Exatamente. As palavras-chave da filosofia e da ciência em meados do século XIX eram \"natureza\", \"meio ambiente\", \"história\", \"evolução\" e \"crescimento\".<br>Marx havia dito que a consciência humana era um produto da base material de uma sociedade. Darwin mostrou que o homem era o produto de uma longa evolução biológica e o estudo de Freud sobre o inconsciente deixou claro que as ações dos homens frequentemente são devidas a certos impulsos ou instintos \"animais\", próprios de sua natureza.<br>- Acho que estou entendendo mais ou menos o que você está chamando de naturalismo. [..]<br>— Vamos falar agora sobre Darwin. [...]<br>— Mas ele foi realmente um filósofo?<br>- Darwin era biólogo e pesquisador natural. Mas ele foi o cientista que, mais do que qualquer outro em tempos mais modernos, questionou e colocou em dúvida a visão bíblica sobre o lugar do homem na criação.<br>- Então seria bom você falar um pouco sobre a teoria da evolução de Darwin.<br>- [...] Em A origem das espécies, Darwin defendia duas teorias ou teses principais: em primeiro lugar, ele dizia que todas as espécies de plantas e animais que vivem hoje descendem de formas mais primitivas, que viveram em tempos passados. Ele pressupõe, portanto, uma evolução biológica. Em segundo, Darwin explica que esta evolução se deve à \"seleção natural\".<br>— Só os mais fortes sobrevivem, não é isto?</p><p style=\"margin-left:360px;text-align:justify;\"><br><sup>GAARDER, Jostein. O mundo de Sofia. São Paulo: Companhia das Letras. 1998. p. 432-5.</sup></p>\n\n        <div style=\"padding-bottom: 12px;\"></div>\n        <p style=\"text-align:justify;\">Marx, Darwin e Freud foram importantes nomes para a estruturação do Realismo na sua concepção. No entanto, apresentaram concepções que revelaram o campo de atuação de cada um, também conhecidos como ‘’os ismos'' do século XIX, que os distinguia facilmente. Com isso, releia o fragmento do texto e cite uma palavra ou expressão que faça relação à área de atuação de cada um desses pensadores.&nbsp;</p>\n      </div>\n    "
